from sympy import primefactors
def a(n):
    pf = primefactors(n)
    if pf: min_pf2 = min(pf)**2
    for i in pf:
        if i > min_pf2: return i
    return 1
print([n//a(n) for n in range(1, 151)]) # _Indranil Ghosh_, Mar 24 2017

